import java.util.Scanner;

public class Main {
    static int H, W;
    static char[][] board;
    static int[][][] dp;

    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        H = scanner.nextInt();
        W = scanner.nextInt();
        board = new char[H][W];
        dp = new int[H][W][2];

        for (int i = 0; i < H; i++) {
            String line = scanner.next();
            for (int j = 0; j < W; j++) {
                board[i][j] = line.charAt(j);
            }
        }

        if (solve(0, 0, 0)) {
            System.out.println("First");
        } else {
            System.out.println("Second");
        }
    }

    static boolean solve(int i, int j, int player) {
        if (i == H) {
            return true;
        }
        if (j == W) {
            return solve(i + 1, 0, player);
        }
        if (dp[i][j][player] != 0) {
            return dp[i][j][player] == 1;
        }

        boolean res = false;
        if (board[i][j] == '.') {
            res |= solve(i, j + 1, player);
            res |= solve(i + 1, j, player);
            res |= solve(i, j - 1, player);
            res |= solve(i - 1, j, player);
            res |= solve(i + 1, j + 1, player);
            res |= solve(i + 1, j - 1, player);
            res |= solve(i - 1, j + 1, player);
            res |= solve(i - 1, j - 1, player);
        } else {
            res |= solve(i, j + 1, player);
            res |= solve(i + 1, j, player);
            res |= solve(i, j - 1, player);
            res |= solve(i - 1, j, player);
        }

        dp[i][j][player] = res ? 1 : 0;
        return res;
    }
}
